VALUES ('3760094448634', 'Jarret De Bœuf Aux Petits Légumes', 'Jarret de bœuf mariné 58% (origine : France), concassée de tomate 18% (pulpe de tomate, jus de tomates, acidifiant : acide citrique), oignon 3,9%, lardon (poitrine de porc, eau, sel, conservateur : nitrite de sodium), crème (crème de _LAIT_, stabilisant : carraghénanes), carotte 2,6%, tomate mi-séchée 2,1% (tomate, huile de colza, sel, ail, origan), vin rouge de Bourgogne 1,5%, _CÉLERI_ 1,4%, arômes naturels, échalote, farine de _BLÉ_, _BEURRE_, huile d\'olive vierge extra, sel, paprika 0,2%, ail, thym, cumin, poivre.', 'https://static.openfoodfacts.org/images/products/376/009/444/8634/front_fr.21.400.jpg', '7', '2.7', '4.5', '2.5', '0.8', '22', '1.15', '0.452755905511811', '', '0');

